script: |
  super -f text -I q9810.spq | sort > q9810.out

inputs:
  - name: q9810.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE + - ( + col1 ) * + 96 NOT IN ( - 73 * + col0 + 79 + - col2 * + - col0 );
  - name: tab1

outputs:
  - name: q9810.out
    data: |
      51	14	96
      85	5	59
      91	47	68
